import React, { useState } from "react";
import GamePreview from "../components/GamePreview";
import "../styles/Shop.css";

const Shop = function(){
    const [games, setgames] = useState([
        {id: 1, title: 'TowerDefence', description: 'A little bit about the good'},
        {id: 2, title: 'Infernal Crusade', description: 'A little bit about the good'},
        {id: 3, title: 'Tail of Marx', description: 'A little bit about the good'},
        {id: 4, title: 'Serious John', description: 'A little bit about the good'},
    ])
    return (
        <div>
            <h1 className="shopTitle">All games</h1>
            <div className="gameList">
                {games.map(game => <GamePreview  game = {game} key = {game.id} />)}
            </div>
        </div>
    );
}

export default Shop;
